public class Main {


    public static void main(String[] args) {


        System.out.println("Answer: "+sumUp(5));
        System.out.println("Answer: "+sumBetweenNumbers(3, 5));
    }

    public static int sumUp(int max){
        int answer = 0;

        //recursive function of adding numbers (if max is 10 then addition will be 10+9+8....
        //if max become zero the recursive terminates
        if(max > 0){
            return max + sumUp(max - 1);
        }
        return 0;
    }

    public static int sumBetweenNumbers(int start, int end){

        //recursive will occur when starting number is less than end number eg start=3, end=5
        //execute will be 5 + 4 when end - 1 = 3 the condition becomes false then recursive will terminate
        if(start < end){
            return end + sumBetweenNumbers(start, end - 1);
        }
        return 0;
    }
}

